import React, { useState } from 'react';

const VideoTrimmer: React.FC<{ videoDuration: number }> = ({ videoDuration }) => {
  const [startTrim, setStartTrim] = useState(0);
  const [endTrim, setEndTrim] = useState(videoDuration);

  return (
    <div>
      <label>Start: {startTrim}s</label>
      <input 
        type="range" 
        min="0" 
        max={videoDuration} 
        value={startTrim} 
        onChange={(e) => setStartTrim(Number(e.target.value))} 
      />
      <label>End: {endTrim}s</label>
      <input 
        type="range" 
        min="0" 
        max={videoDuration} 
        value={endTrim} 
        onChange={(e) => setEndTrim(Number(e.target.value))} 
      />
      <p>Trimmed Duration: {endTrim - startTrim} seconds</p>
    </div>
  );
};

export default VideoTrimmer;
